INSERT INTO `places` (`id`, `name`, `description`, `zoom`, `moderated`, `moderator_comments`, `global_access`, `global_copy`, `parent_id`, `user_id`, `coordinate_id`, `source_id`, `start_moderation_date`, `end_moderation_date`) VALUES (4, 'Главный корпус УО \"ГрГУ им. Янки Купалы\"', '<p style=\"margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden; font-size: 15px; text-align: justify; line-height: 18px; font-family: \'PT Sans Narrow\', \'Arial Narrow\', sans-serif;\"><font color=\"darkblue\" size=\"3\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden;\"><b style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden;\">Количество студентов</b></font></p><p style=\"margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden; font-size: 15px; text-align: justify; line-height: 18px; font-family: \'PT Sans Narrow\', \'Arial Narrow\', sans-serif;\">На&nbsp;<strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden;\">01.01.2014</strong>&nbsp;года численность студентов Гродненского государственного университета составляет:&nbsp;<strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden;\">15 971&nbsp;</strong>человек.</p><p style=\"margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden; font-size: 15px; text-align: justify; line-height: 18px; font-family: \'PT Sans Narrow\', \'Arial Narrow\', sans-serif;\">В 2013 году было принято:&nbsp;<strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden;\">2 951</strong>&nbsp;студент.</p><p style=\"margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden; font-size: 15px; text-align: justify; line-height: 18px; font-family: \'PT Sans Narrow\', \'Arial Narrow\', sans-serif;\">На второй ступени высшего образования обучается:&nbsp;<strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden;\">315</strong>&nbsp;магистрантов.</p><p style=\"margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden; font-size: 15px; text-align: justify; line-height: 18px; font-family: \'PT Sans Narrow\', \'Arial Narrow\', sans-serif;\">В аспирантуре университета обучается:&nbsp;<b style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden;\">169</b>&nbsp;аспирантов,&nbsp;<strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden;\">3</strong>&nbsp;докторанта.</p><p style=\"margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden; font-size: 15px; text-align: justify; line-height: 18px; font-family: \'PT Sans Narrow\', \'Arial Narrow\', sans-serif;\">В колледжах университета обучается:&nbsp;<strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden;\">4</strong><b style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden;\">&nbsp;841</b>&nbsp;учащихся.</p><p style=\"margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden; font-size: 15px; text-align: justify; line-height: 18px; font-family: \'PT Sans Narrow\', \'Arial Narrow\', sans-serif;\"><font color=\"darkblue\" size=\"3\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden;\"><b style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden;\">Количество сотрудников</b></font></p><p style=\"margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden; font-size: 15px; text-align: justify; line-height: 18px; font-family: \'PT Sans Narrow\', \'Arial Narrow\', sans-serif;\">На&nbsp;<strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden;\">1</strong><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden;\">5</strong><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden;\">.01.2014</strong>&nbsp;года в Гродненском государственном университете&nbsp;<b style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden;\">2 168&nbsp;</b>сотрудников Из них:</p><p style=\"margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden; font-size: 15px; text-align: justify; line-height: 18px; font-family: \'PT Sans Narrow\', \'Arial Narrow\', sans-serif;\">Профессорско-преподавательский состав&nbsp;<strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden;\">887</strong>&nbsp;человек, из них:</p><p style=\"margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden; font-size: 15px; text-align: justify; line-height: 18px; font-family: \'PT Sans Narrow\', \'Arial Narrow\', sans-serif;\">Докторов наук -&nbsp;<b style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden;\">50</b>&nbsp;человек</p><p style=\"margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden; font-size: 15px; text-align: justify; line-height: 18px; font-family: \'PT Sans Narrow\', \'Arial Narrow\', sans-serif;\">Профессоров -&nbsp;<strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden;\">42&nbsp;</strong>человека</p><p style=\"margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden; font-size: 15px; text-align: justify; line-height: 18px; font-family: \'PT Sans Narrow\', \'Arial Narrow\', sans-serif;\">Доцентов -&nbsp;<b style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden;\">277</b>&nbsp;человек</p><p style=\"margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden; font-size: 15px; text-align: justify; line-height: 18px; font-family: \'PT Sans Narrow\', \'Arial Narrow\', sans-serif;\">Кандидатов наук –&nbsp;<b style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; -webkit-transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; transition: background-color 100ms ease-in, background-position 0s ease-in, border-color 100ms ease-in, color 50ms ease; -webkit-backface-visibility: hidden;\">323</b>&nbsp;человек</p>', 17, '', '', '', '\0', 3, 2, 4, NULL, '2014-04-09 04:15:36', '2014-04-09 05:45:24');
INSERT INTO `places` (`id`, `name`, `description`, `zoom`, `moderated`, `moderator_comments`, `global_access`, `global_copy`, `parent_id`, `user_id`, `coordinate_id`, `source_id`, `start_moderation_date`, `end_moderation_date`) VALUES (5, 'Главный корпус УО \"ГрГМУ\"', '<span style=\"font-family: Arial, Helvetica, sans-serif; text-align: justify; background-color: rgb(245, 245, 245);\">Учреждение образования «Гродненский государственный медицинский университет» – первый из медицинских вузов Республики Беларусь, в котором была внедрена и сертифицирована система менеджмента качества, соответствующая требованиям ISO 9001 в национальной (СТБ ISO 9001-2009) и немецкой (DIN EN 9001-2008) системах.</span>', 15, '', '', '', '\0', 3, 2, 5, NULL, '2014-04-09 04:35:48', '2014-05-11 10:33:32');
INSERT INTO `places` (`id`, `name`, `description`, `zoom`, `moderated`, `moderator_comments`, `global_access`, `global_copy`, `parent_id`, `user_id`, `coordinate_id`, `source_id`, `start_moderation_date`, `end_moderation_date`) VALUES (6, 'Главный корпус УО \"ГГАУ\"', '<p style=\"outline: 0px; padding: 0px; margin: 15px 0px 0px; border: 0px; color: rgb(59, 59, 59); font-family: Tahoma, Geneva, sans-serif; font-size: 14px; line-height: 17.68000030517578px; background-color: rgb(255, 255, 255);\">Учреждение образования \"Гродненский государственный аграрный университет\" является крупнейшим образовательным и научным центром Западного региона Беларуси. Вуз был основан в 1951 году. За 60 лет здесь подготовлено свыше 26 тысяч специалистов, прошли переподготовку и повысили квалификацию около 50 тысяч руководителей и специалистов АПК.</p><p style=\"outline: 0px; padding: 0px; margin: 15px 0px 0px; border: 0px; color: rgb(59, 59, 59); font-family: Tahoma, Geneva, sans-serif; font-size: 14px; line-height: 17.68000030517578px; background-color: rgb(255, 255, 255);\">В университете разработана и внедрена система менеджмента качества в национальной системе СТБ ISO 9001-2009 и немецкой DIN EN ISO 9001:2008.</p>', 15, '', '', '', '\0', 3, 2, 6, NULL, '2014-04-09 04:37:47', '2014-05-11 10:33:37');
