0381469727px; text-align: justify;\">Дополнительные услуги:&nbsp;</span><br style=\"font-family: Tahoma; font-size: 12px; line-height: 15.600000381469727px; text-align: justify;\"><span style=\"font-family: Tahoma; font-size: 12px; line-height: 15.600000381469727px; text-align: justify;\">компьютерный клуб «Кредо», прокат DVD-дисков&nbsp;</span><br style=\"font-family: Tahoma; font-size: 12px; line-height: 15.600000381469727px; text-align: justify;\"><span style=\"font-family: Tahoma; font-size: 12px; line-height: 15.600000381469727px; text-align: justify;\">Работает кино-бар «Чарли»</span></span>', 18, '', '', '', '\0', 6, 2, 11, NULL, '2014-05-11 09:30:16', '2014-05-11 09:46:33');
