s_right-txt\" style=\"width: 220px; display: inline-block; text-transform: none;\">1 Зал (60 мест) для некурящих, 2 Зал (15 мест) для некурящих</span></span></li><li class=\"b-ps-features_item  \" style=\"padding: 10px; font-size: 12px; text-transform: uppercase;\"><span class=\"b-ps-features_left-txt\" style=\"display: inline-block; width: 250px; padding-right: 25px; vertical-align: top; font-family: CirceBold;\">ОРГАНИЗАЦИОННЫЕ ВОЗМОЖНОСТИ</span>&nbsp;<span class=\"b-ps-features_right-txt\" style=\"width: 220px; display: inline-block; text-transform: none;\">Банкетное обслуживание, Вечеринки, Выездное обслуживание, Деловые переговоры, Организация детских праздников, Презентации, Свадьба, Фуршет</span></li><li class=\"b-ps-features_item __odd \" style=\"padding: 10px; font-size: 12px; text-transform: uppercase;\"><span class=\"b-ps-features_left-txt\" style=\"display: inline-block; width: 250px; padding-right: 25px; vertical-align: top; font-family: CirceBold;\">ОСОБЕННОСТИ МЕНЮ</span>&nbsp;<span class=\"b-ps-features_right-txt\" style=\"width: 220px; display: inline-block; text-transform: none;\">Бизнес-ланч, Гриль, Десертная карта, Карта вин, Коктейльная карта, Кофейная карта, Меню барных закусок, Постное меню, Разливное пиво, Салат-бар, Свежая выпечка, Чайная карта, Шашлык</span></li></ul></span></li></ul>', 18, '', '', '', '\0', 7, 2, 18, NULL, '2014-05-11 10:01:46', '2014-05-11 10:27:10');
