pan class=\"b-ps-features_right-txt\" style=\"width: 220px; display: inline-block; text-transform: none;\">Банкетное обслуживание, Вечеринки, Деловые переговоры, Корпоративное обслуживание, Презентации, Свадьба, Фуршет</span></span></li><li class=\"b-ps-features_item __odd \" style=\"padding: 10px; font-size: 12px; text-transform: uppercase;\"><span style=\"background-color: rgb(255, 255, 255);\"><span class=\"b-ps-features_left-txt\" style=\"display: inline-block; width: 250px; padding-right: 25px; vertical-align: top; font-family: CirceBold;\">ОСОБЕННОСТИ МЕНЮ</span> <span class=\"b-ps-features_right-txt\" style=\"width: 220px; display: inline-block; text-transform: none;\">Бизнес-ланч, Гриль, Десертная карта, Детское меню, Карта вин, Коктейльная карта, Кофейная карта, Меню барных закусок, Пицца, Постное меню, Разливное пиво, Салат-бар, Свежая выпечка, Свежевыжатые соки, Чайная карта</span></span></li><li class=\"b-ps-features_item  \" style=\"padding: 10px; font-size: 12px; text-transform: uppercase;\"><span style=\"background-color: rgb(255, 255, 255);\"><span class=\"b-ps-features_left-txt\" style=\"display: inline-block; width: 250px; padding-right: 25px; vertical-align: top; font-family: CirceBold;\">БИЗНЕС-ЛАНЧ</span> <span class=\"b-ps-features_right-txt\" style=\"width: 220px; display: inline-block; text-transform: none;\">13:00 – 16:00</span></span></li><li class=\"b-ps-features_item __odd \" style=\"padding: 10px; font-size: 12px; text-transform: uppercase;\"><span style=\"background-color: rgb(255, 255, 255);\"><span class=\"b-ps-features_left-txt\" style=\"display: inline-block; width: 250px; padding-right: 25px; vertical-align: top; font-family: CirceBold;\">ОСОБЕННОСТИ ОБСЛУЖИВАНИЯ</span> <span class=\"b-ps-features_right-txt\" style=\"width: 220px; display: inline-block; text-transform: none;\">VIP-комната, Еда на вынос, Фоновая музыка</span></span></li><li class=\"b-ps-features_item  \" style=\"padding: 10px; font-size: 12px; text-transform: uppercase;\"><span class=\"b-ps-features_left-txt\" style=\"display: inline-block; width: 250px; padding-right: 25px; vertical-align: top; font-family: CirceBold;\">КОНДИЦИОНЕРЫ</span> <span class=\"b-ps-features_right-txt\" style=\"width: 220px; display: inline-block; text-transform: none;\">Есть</span></li></ul></li><li class=\"b-institution-description_info_item\" style=\"padding: 8px 0px 0px; display: inline-block; vertical-align: top; margin: 0px 35px 0px 0px; line-height: 1.3; position: relative; max-width: 260px;\"><span class=\"b-institution-description_info_item_txt\" style=\"display: block; padding: 0px 0px 2px; font-size: 12px;\"><br></span></li></ul>', 18, '', '', '', '\0', 7, 2, 20, NULL, '2014-05-11 10:13:13', '2014-05-11 10:27:15');
INSERT INTO `places` (`id`, `name`, `description`, `zoom`, `moderated`, `moderator_comments`, `global_access`, `global_copy`, `parent_id`, `user_id`, `coordinate_id`, `source_id`, `start_moderation_date`, `end_moderation_date`) VALUES (21, 'Старый Замок', '<span style=\"font-family: Tahoma; font-size: 12px; line-height: 15.600000381469727px; text-align: justify; background-color: rgb(255, 255, 255);\">Cтарый замок построен в кон. 14 нач. 15 в.в. как оборонительное сооружение по приказу князя Великого княжества Литовского Витовта. Около 1580 г. перестроен по приказу польского короля Стефана Батория по проекту итальянского архитектора Санти Гучи и фортификатора Рудольфино де Камерино. На первом этаже располагались: королевская канцелярия, архив, казна, стража, служебные помещения. На втором этаже королевские покои. Фасады дворца украшали сграффито и резьба. Декоративное оформление выполнено в традициях ренессанса. В последующем перестраивался на протяжении 17-19 в.в. Использовался как княжеская, королевская резиденции, административное здание, госпиталь. В настоящее время в замке находится учреждение культуры «Гродненский государственный историко-археологический музей». Открыт для посетителей с 10.00 до 18.00 (кроме понедельника).</span>', 15, '', '', '', '\0', NULL, 2, 21, NULL, '2014-05-11 10:23:39', '2014-05-11 10:27:27');
INSERT INTO `places` (`id`, `name`, `description`, `zoom`, `moderated`, `moderator_comments`, `global_access`, `global_copy`, `parent_id`, `user_id`, `coordinate_id`, `source_id`, `start_moderation_date`, `end_moderation_date`) VALUES (22, 'Новый Замок', '<span style=\"font-family: Tahoma; font-size: 12px; line-height: 15.600000381469727px; text-align: justify; background-color: rgb(255, 255, 255);\">Новый (Нижний) замок построили в 1734 — 1751 гг. дрезденские архитекторы М.Д. Пёпельман и И.Ф. Кнобель. Для заседаний сейма залы подготавливал в 1752г. И.Х. Яух. Здесь прошли сеймы 1784 и 1793 гг. На заседаниях последнего был осуществлен второй раздел Речи Посполитой. С 1 января 1795 по 15 февраля 1797г. в Новом замке жил польский король Станислав Август Понятовский. Мемориальная доска на стене замка напоминает о событиях восстания 1794г., когда в дни наступления А. Суворова в Беларуси Т. Костюшко в ночь с 29 на 30 сентября был в Новом замке — месте заседаний Гродненской порядковой комиссии — и вручил памятные перстни с надписью «Родина — своему защитнику» Я. Ясинскому, Т. Вовжецкому, А.Гедройпу и другим.</span>', 15, '', '', '', '\0', NULL, 2, 22, NULL, '2014-05-11 10:25:48', '2014-05-11 10:27:32');
