INSERT INTO `places` (`id`, `name`, `description`, `zoom`, `moderated`, `moderator_comments`, `global_access`, `global_copy`, `parent_id`, `user_id`, `coordinate_id`, `source_id`, `start_moderation_date`, `end_moderation_date`) VALUES (26, 'Старый Замок', '<span style=\"font-family: Tahoma; font-size: 12px; line-height: 15.600000381469727px; text-align: justify; background-color: rgb(255, 255, 255);\">Cтарый замок построен в кон. 14 нач. 15 в.в. как оборонительное сооружение по приказу князя Великого княжества Литовского Витовта. Около 1580 г. перестроен по приказу польского короля Стефана Батория по проекту итальянского архитектора Санти Гучи и фортификатора Рудольфино де Камерино. На первом этаже располагались: королевская канцелярия, архив, казна, стража, служебные помещения. На втором этаже королевские покои. Фасады дворца украшали сграффито и резьба. Декоративное оформление выполнено в традициях ренессанса. В последующем перестраивался на протяжении 17-19 в.в. Использовался как княжеская, королевская резиденции, административное здание, госпиталь. В настоящее время в замке находится учреждение культуры «Гродненский государственный историко-археологический музей». Открыт для посетителей с 10.00 до 18.00 (кроме понедельника).</span>', 15, '', '', '', '', NULL, 2, 26, 21, '2014-05-11 10:23:39', '2014-05-11 10:27:27');
INSERT INTO `places` (`id`, `name`, `description`, `zoom`, `moderated`, `moderator_comments`, `global_access`, `global_copy`, `parent_id`, `user_id`, `coordinate_id`, `source_id`, `start_moderation_date`, `end_moderation_date`) VALUES (27, 'Новый Замок', '<span style=\"font-family: Tahoma; font-size: 12px; line-height: 15.600000381469727px; text-align: justify; background-color: rgb(255, 255, 255);\">Новый (Нижний) замок построили в 1734 — 1751 гг. дрезденские архитекторы М.Д. Пёпельман и И.Ф. Кнобель. Для заседаний сейма залы подготавливал в 1752г. И.Х. Яух. Здесь прошли сеймы 1784 и 1793 гг. На заседаниях последнего был осуществлен второй раздел Речи Посполитой. С 1 января 1795 по 15 февраля 1797г. в Новом замке жил польский король Станислав Август Понятовский. Мемориальная доска на стене замка напоминает о событиях восстания 1794г., когда в дни наступления А. Суворова в Беларуси Т. Костюшко в ночь с 29 на 30 сентября был в Новом замке — месте заседаний Гродненской порядковой комиссии — и вручил памятные перстни с надписью «Родина — своему защитнику» Я. Ясинскому, Т. Вовжецкому, А.Гедройпу и другим.</span>', 15, '', '', '', '', NULL, 2, 27, 22, '2014-05-11 10:25:48', '2014-05-11 10:27:32');
INSERT INTO `places` (`id`, `name`, `description`, `zoom`, `moderated`, `moderator_comments`, `global_access`, `global_copy`, `parent_id`, `user_id`, `coordinate_id`, `source_id`, `start_moderation_date`, `end_moderation_date`) VALUES (28, 'Главный корпус УО \"ГрГМУ\"', '<span style=\"font-family: Arial, Helvetica, sans-serif; text-align: justify; background-color: rgb(245, 245, 245);\">Учреждение образования «Гродненский государственный медицинский университет» – первый из медицинских вузов Республики Беларусь, в котором была внедрена и сертифицирована система менеджмента качества, соответствующая требованиям ISO 9001 в национальной (СТБ ISO 9001-2009) и немецкой (DIN EN 9001-2008) системах.</span>', 15, '', '', '', '', 3, 2, 28, 5, '2014-04-09 04:35:48', '2014-05-11 10:33:32');
INSERT INTO `places` (`id`, `name`, `description`, `zoom`, `moderated`, `moderator_comments`, `global_access`, `global_copy`, `parent_id`, `user_id`, `coordinate_id`, `source_id`, `start_moderation_date`, `end_moderation_date`) VALUES (29, 'Главный корпус УО \"ГГАУ\"', '<p style=\"outline: 0px; padding: 0px; margin: 15px 0px 0px; border: 0px; color: rgb(59, 59, 59); font-family: Tahoma, Geneva, sans-serif; font-size: 14px; line-height: 17.68000030517578px; background-color: rgb(255, 255, 255);\">Учреждение образования \"Гродненский государственный аграрный университет\" является крупнейшим образовательным и научным центром Западного региона Беларуси. Вуз был основан в 1951 году. За 60 лет здесь подготовлено свыше 26 тысяч специалистов, прошли переподготовку и повысили квалификацию около 50 тысяч руководителей и специалистов АПК.</p><p style=\"outline: 0px; padding: 0px; margin: 15px 0px 0px; border: 0px; color: rgb(59, 59, 59); font-family: Tahoma, Geneva, sans-serif; font-size: 14px; line-height: 17.68000030517578px; background-color: rgb(255, 255, 255);\">В университете разработана и внедрена система менеджмента качества в национальной системе СТБ ISO 9001-2009 и немецкой DIN EN ISO 9001:2008.</p>', 15, '', '', '', '', 3, 2, 29, 6, '2014-04-09 04:37:47', '2014-05-11 10:33:37');
INSERT INTO `places` (`id`, `name`, `description`, `zoom`, `moderated`, `moderator_comments`, `global_access`, `global_copy`, `parent_id`, `user_id`, `coordinate_id`, `source_id`, `start_moderation_date`, `end_moderation_date`) VALUES (30, 'Коложская церковь', '<div><span style=\"color: rgb(37, 37, 37); font-family: sans-serif; font-size: 14px; line-height: 22.399999618530273px; background-color: rgb(255, 255, 255);\">Коложская церковь представляет собой крестово-купольный храм, трёхапсидный и шестистолпный. Кладка стен выполнена из&nbsp;</span><a href=\"http://ru.wikipedia.org/wiki/%D0%9F%D0%BB%D0%B8%D0%BD%D1%84%D0%B0\" title=\"Плинфа\" style=\"text-decoration: none; background-image: none; background-color: rgb(255, 255, 255); font-family: sans-serif; font-size: 14px; line-height: 22.399999618530273px; color: rgb(0, 0, 0);\">плинфы</a><span style=\"color: rgb(37, 37, 37); font-family: sans-serif; font-size: 14px; line-height: 22.399999618530273px; background-color: rgb(255, 255, 255);\">, использован также кирпич в декоративных целях. Церковь снаружи не оштукатурена, что позволяет видеть декоративные достоинства её полихромной кладки. Фасады украшены декоративными вставками из отполированных гранитных и гнейсовых валунов определённой цветовой гаммы (красные, коричневые, тёмно-малиновые, серо-зелёные, оливковые). Верхняя часть стен украшена поливными керамическими плитками. Стены сохранилась не полностью, так как в 1853 году, в результате оползня, частично обрушились; до нашего времени также не дошли первоначальная главка и своды. В стены церкви вмурованы многочисленные&nbsp;</span><a href=\"http://ru.wikipedia.org/wiki/%D0%93%D0%BE%D0%BB%D0%BE%D1%81%D0%BD%D0%B8%D0%BA\" title=\"Голосник\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-color: rgb(255, 255, 255); font-family: sans-serif; font-size: 14px; line-height: 22.399999618530273px;\">кувшины-голосники</a><span style=\"color: rgb(37, 37, 37); font-family: sans-serif; font-size: 14px; line-height: 22.399999618530273px; background-color: rgb(255, 255, 255);\">, улучшающие акустику храма. Пол был украшен сложным узором из&nbsp;</span><a href=\"http://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D0%B9%D0%BE%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"Майолика\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-color: rgb(255, 255, 255); font-family: sans-serif; font-size: 14px; line-height: 22.399999618530273px;\">майоликовой</a><span style=\"color: rgb(37, 37, 37); font-family: sans-serif; font-size: 14px; line-height: 22.399999618530273px; background-color: rgb(255, 255, 255);\">&nbsp;плитки. При реставрации в 1870 году были открыты старинные фрески в конхах.</span></div>', 13, NULL, NULL, '', '\0', NULL, 2, 30, NULL, '2014-05-11 12:32:30', NULL);
INSERT INTO `places` (`id`, `name`, `description`, `zoom`, `moderated`, `moderator_comments`, `global_access`, `global_copy`, `parent_id`, `user_id`, `coordinate_id`, `source_id`, `start_moderation_date`, `end_moderation_date`) VALUES (31, 'Драматический театр', '<b style=\"font-family: sans-serif; font-size: 14px; line-height: 22.399999618530273px; background-color: rgb(255, 255, 255);\">Гродненский областной драматический театр</b><span style=\"font-family: sans-serif; font-size: 14px; line-height: 22.399999618530273px; background-color: rgb(255, 255, 255);\">&nbsp;— профессиональный государственный театр&nbsp;</span><a href=\"http://ru.wikipedia.org/wiki/%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0_%D0%91%D0%B5%D0%BB%D0%B0%D1%80%D1%83%D1%81%D1%8C\" title=\"Республика Беларусь\" class=\"mw-redirect\" style=\"text-decoration: none; background-image: none; background-color: rgb(255, 255, 255); font-family: sans-serif; font-size: 14px; line-height: 22.399999618530273px; color: rgb(0, 0, 0);\">Республики Беларусь</a><span style=\"font-family: sans-serif; font-size: 14px; line-height: 22.399999618530273px; background-color: rgb(255, 255, 255);\">, образованный в&nbsp;</span><a href=\"http://ru.wikipedia.org/wiki/1947_%D0%B3%D0%BE%D0%B4\" title=\"1947 год\" style=\"color: rgb(0, 0, 0); text-decoration: none; background-image: none; background-color: rgb(255, 255, 255); font-family: sans-serif; font-size: 14px; line-height: 22.399999618530273px;\">1947 году</a><span style=\"font-family: sans-serif; font-size: 14px; line-height: 22.399999618530273px; background-color: rgb(255, 255, 255);\">.<br></span><p style=\"margin: 0.5em 0px; line-height: 22.399999618530273px; font-family: sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">Вначале спектакли проходили в здании театра гродненского старосты&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%A2%D0%B8%D0%B7%D0%B5%D0%BD%D0%B3%D0%B0%D1%83%D0%B7,_%D0%90%D0%BD%D1%82%D0%BE%D0%BD%D0%B8%D0%B9\" title=\"Тизенгауз, Антоний\" style=\"text-decoration: none; background-image: none; color: rgb(0, 0, 0);\">А. Тизенгауза</a>, построенном в 1780-е гг.&nbsp;</p><p style=\"margin: 0.5em 0px; line-height: 22.399999618530273px; font-family: sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">В&nbsp;<a href=\"http://ru.wikipedia.org/wiki/1984\" title=\"1984\" class=\"mw-redirect\" style=\"text-decoration: none; background-image: none; color: rgb(0, 0, 0);\">1984</a>&nbsp;для театра построено новое здание (арх. Г. Мачульский) из кирпича и сборного железобетона: зрительный зал с амфитетаром и балконом на 700 мест, вестибюлем и фойе и административный корпус с малым зрительным залом на 216 мест на первом этаже. В цокольном этаже репетиционный зал, актёрские комнаты, аппаратная, склад декораций. У входа в театр ― трёхфигурная скульптурная композиция скульптора Л. Зильбера.Расположенное на высоком берегу&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%9D%D0%B5%D0%BC%D0%B0%D0%BD\" title=\"Неман\" style=\"text-decoration: none; background-image: none; color: rgb(0, 0, 0);\">Немана</a>, здание Гродненского областного драматического театра является одним из символов&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%93%D1%80%D0%BE%D0%B4%D0%BD%D0%BE\" title=\"Гродно\" style=\"color: rgb(0, 0, 0); text-decoration: none; background-image: none;\">Гродно</a>.</p><span style=\"font-family: sans-serif; font-size: 14px; line-height: 22.399999618530273px; background-color: rgb(255, 255, 255);\"></span>', 16, '', '', '', '\0', NULL, 2, 31, NULL, '2014-05-12 11:00:18', '2014-05-12 11:03:30');
INSERT INTO `places` (`id`, `name`, `description`, `zoom`, `moderated`, `moderator_comments`, `global_access`, `global_copy`, `parent_id`, `user_id`, `coordinate_id`, `source_id`, `start_moderation_date`, `end_moderation_date`) VALUES (32, 'Драматический театр', '<b style=\"font-family: sans-serif; font-size: 14px; line-height: 22.399999618530273px; background-color: rgb(255, 255, 255);\">Гродненский областной драматический театр</b><span style=\"font-family: sans-serif; font-size: 14px; line-height: 22.399999618530273px; background-color: rgb(255, 255, 255);\">&nbsp;— профессиональный государственный театр&nbsp;</span><a href=\"http://ru.wikipedia.org/wiki/%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0_%D0%91%D0%B5%D0%BB%D0%B0%D1%80%D1%83%D1%81%D1%8C\" title=\"Республика Беларусь\" class=\"mw-redirect\" style=\"text-decoration: none; background-image: none; background-color: rgb(255, 255, 255); font-family: sans-serif; font-size: 14px; line-height: 22.399999618530273px; color: rgb(0, 0, 0);\">Республики Беларусь</a><span style=\"font-family: sans-serif; font-size: 14px; line-height: 22.399999618530273px; background-color: rgb(255, 255, 255);\">, образованный в&nbsp;</span><a href=\"http://ru.wikipedia.org/wiki/1947_%D0%B3%D0%BE%D0%B4\" title=\"1947 год\" style=\"color: rgb(0, 0, 0); text-decoration: none; background-image: none; background-color: rgb(255, 255, 255); font-family: sans-serif; font-size: 14px; line-height: 22.399999618530273px;\">1947 году</a><span style=\"font-family: sans-serif; font-size: 14px; line-height: 22.399999618530273px; background-color: rgb(255, 255, 255);\">.<br></span><p style=\"margin: 0.5em 0px; line-height: 22.399999618530273px; font-family: sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">Вначале спектакли проходили в здании театра гродненского старосты&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%A2%D0%B8%D0%B7%D0%B5%D0%BD%D0%B3%D0%B0%D1%83%D0%B7,_%D0%90%D0%BD%D1%82%D0%BE%D0%BD%D0%B8%D0%B9\" title=\"Тизенгауз, Антоний\" style=\"text-decoration: none; background-image: none; color: rgb(0, 0, 0);\">А. Тизенгауза</a>, построенном в 1780-е гг.&nbsp;</p><p style=\"margin: 0.5em 0px; line-height: 22.399999618530273px; font-family: sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">В&nbsp;<a href=\"http://ru.wikipedia.org/wiki/1984\" title=\"1984\" class=\"mw-redirect\" style=\"text-decoration: none; background-image: none; color: rgb(0, 0, 0);\">1984</a>&nbsp;для театра построено новое здание (арх. Г. Мачульский) из кирпича и сборного железобетона: зрительный зал с амфитетаром и балконом на 700 мест, вестибюлем и фойе и административный корпус с малым зрительным залом на 216 мест на первом этаже. В цокольном этаже репетиционный зал, актёрские комнаты, аппаратная, склад декораций. У входа в театр ― трёхфигурная скульптурная композиция скульптора Л. Зильбера.Расположенное на высоком берегу&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%9D%D0%B5%D0%BC%D0%B0%D0%BD\" title=\"Неман\" style=\"text-decoration: none; background-image: none; color: rgb(0, 0, 0);\">Немана</a>, здание Гродненского областного драматического театра является одним из символов&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%93%D1%80%D0%BE%D0%B4%D0%BD%D0%BE\" title=\"Гродно\" style=\"color: rgb(0, 0, 0); text-decoration: none; background-image: none;\">Гродно</a>.</p><span style=\"font-family: sans-serif; font-size: 14px; line-height: 22.399999618530273px; background-color: rgb(255, 255, 255);\"></span>', 16, '', '', '', '', NULL, 2, 32, 31, '2014-05-12 11:00:18', '2014-05-12 11:03:30');
